export const useGetUserByParentId = () => {
    
    const { data: parentPostUser } = useQuery(
        ['postResponseUser', { post_id: id }], () => 
        getPostById(parent_id).then(post => 
            getUserById(post.user_id)), 
        {
            enabled: !!parent_id
        }
    )

    return parentPostUser;
    
}
